  font-weight: 700;
  line-height: 1.35em;
  color: rgb(233,115,40)
`
const BtnSection = styled.section`
  display: flex;
  justify-content: space-between;
  width: 100%;
  margin: 15px 0

`
const Btn = styled.button`
  padding: 6px;
  width: 95px;
