`

const Image = styled.img`
  width: 50%;
`

export default function HomeHeader() {
  return (
    <Main>
      <LeftArea>
        <section>
          <Titles>
            <h2>Neuroscientist.</h2>
            <h2>PH.D Candidate.</h2>
            <h2>Writer.</h2>
          </Titles>
          <BtnSection>
            <Btn>What I Do</Btn>
            <Btn>Blog</Btn>
            <Btn>Contact Me</Btn>
          </BtnSection>
        </section>
      </LeftArea>
      <Image src={ashlea} alt="" />
    </Main>
  )
}
